import React, { useEffect } from 'react';
import $ from 'jquery';
import DataTable from 'datatables.net-dt';
import './App.css';

const App = () => {
  useEffect(() => {
    const table = new DataTable('#example');

    return () => {
      table.destroy();
    };
  }, []);

  return (
    <div className="container">
      <h1>Patient DataTable</h1>
      <table id="dataTable" className="display">
      </table>
    </div>
  );
};

export default App;
